/*Table structure for table `received_money_lines` */

DROP TABLE IF EXISTS `received_money_lines`;

CREATE TABLE `received_money_lines` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `line_amount` decimal(20,2) NOT NULL,
  `received_money_id` int(11) DEFAULT NULL,
  `line_coa_id` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `received_money_id` (`received_money_id`),
  KEY `line_coa_id` (`line_coa_id`),
  CONSTRAINT `received_money_lines_ibfk_1` FOREIGN KEY (`received_money_id`) REFERENCES `received_moneys` (`id`),
  CONSTRAINT `received_money_lines_ibfk_2` FOREIGN KEY (`line_coa_id`) REFERENCES `coa` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

/*Data for the table `received_money_lines` */

/*Table structure for table `received_moneys` */

DROP TABLE IF EXISTS `received_moneys`;

CREATE TABLE `received_moneys` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `tran_date` date NOT NULL,
  `description` text DEFAULT NULL,
  `reference` text DEFAULT NULL,
  `total` decimal(20,2) NOT NULL,
  `customer_id` int(11) DEFAULT NULL,
  `coa_id` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `customer_id` (`customer_id`),
  KEY `coa_id` (`coa_id`),
  CONSTRAINT `received_moneys_ibfk_1` FOREIGN KEY (`customer_id`) REFERENCES `customers` (`id`),
  CONSTRAINT `received_moneys_ibfk_2` FOREIGN KEY (`coa_id`) REFERENCES `coa` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

/*Data for the table `received_moneys` */

/*Table structure for table `sales` */

DROP TABLE IF EXISTS `sales`;

CREATE TABLE `sales` (
  `sale_id` int(11) DEFAULT NULL,
  `salesman_id` int(11) NOT NULL,
  `doc_number` varchar(110) NOT NULL,
  `customerid` int(11) NOT NULL DEFAULT 0,
  `sale_product` int(11) NOT NULL DEFAULT 0,
  `quantity` int(11) NOT NULL DEFAULT 0,
  `with_shell` int(11) NOT NULL DEFAULT 0,
  `sold_bottles` int(11) NOT NULL DEFAULT 0,
  `sale_price` int(11) NOT NULL DEFAULT 0,
  `date` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  `status` int(11) NOT NULL DEFAULT 0,
  PRIMARY KEY (`doc_number`)
